import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/footer';
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';
import AdminDashboard from './admin/AdminDashboard';
// import PatientDashboard from './pages/PatientDashboard';
import MedecinDashboard from './pages/MedecinDashboard';
import CreateDossier from './pages/CreateDossier';
import MesDossiers from './pages/MesDossiers';
import PrivateRoute from './auth/PrivateRoute';
import PatientDashboard from './pages/Composants/PatientDashboard';
import LoginPatient from './pages/Composants/LoginPatient';

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-grow">
        <Routes>
          {/* Pages publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Dashboard Admin (protégé) */}
          <Route
            path="/admin"
            element={
              <PrivateRoute allowedRoles={['Admin', 'SuperAdmin']}>
                <AdminDashboard />
              </PrivateRoute>
            }
          />

          {/* Dashboard Médecin (protégé) */}
          <Route
            path="/medecin"
            element={
              <PrivateRoute allowedRoles={['Medecin']}>
                <MedecinDashboard />
              </PrivateRoute>
            }
          />
          <Route
            path="/medecin/create-dossier"
            element={
              <PrivateRoute allowedRoles={['Medecin']}>
                <CreateDossier />
              </PrivateRoute>
            }
          />
          <Route
            path="/medecin/mes-dossiers"
            element={
              <PrivateRoute allowedRoles={['Medecin']}>
                <MesDossiers />
              </PrivateRoute>
            }
          />

{/* Pages Patient */}
<Route path="/patient/login" element={<LoginPatient />} />
<Route
  path="/patient/dashboard"
  element={
    <PrivateRoute allowedRoles={["Patient"]}>
      <PatientDashboard />
    </PrivateRoute>
  }
/>
<Route
  path="/patient/mes-dossiers"
  element={
    <PrivateRoute allowedRoles={["Patient"]}>
      <MyDossiers />
    </PrivateRoute>
  }
/>


          {/* Redirection par défaut */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
